INSERT INTO `em_message_info` VALUES (257, NULL, '<p>根据传入的占位符返回格式化后的日期。</p>\n<p>将字符放在方括号中，即可原样返回而不被格式化替换 (例如， [<code>MM</code>])。</p>\n<div class=\"language-js extra-class\">\n<pre class=\"language-js\"><code><span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> \n<span class=\"token comment\">// 默认返回的是 ISO8601 格式字符串 \'2020-04-02T08:02:17-05:00\'</span>\n\n<span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'2019-01-25\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'[YYYYescape] YYYY-MM-DDTHH:mm:ssZ[Z]\'</span><span class=\"token punctuation\">)</span> \n<span class=\"token comment\">// \'YYYYescape 2019-01-25T00:00:00-02:00Z\'</span>\n\n<span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'2019-01-25\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'DD/MM/YYYY\'</span><span class=\"token punctuation\">)</span> <span class=\"token comment\">// \'25/01/2019\'</span></code></pre>\n</div>', NULL, 3003, 10, 13, 'exam-app', '2023-02-01 19:09:50', '2023-02-01 19:09:50');
INSERT INTO `em_message_info` VALUES (258, NULL, '<p>根据传入的占位符返回格式化后的日期。</p>\n<p>将字符放在方括号中，即可原样返回而不被格式化替换 (例如， [<code>MM</code>])。</p>\n<div class=\"language-js extra-class\">\n<pre class=\"language-js\"><code><span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span> \n<span class=\"token comment\">// 默认返回的是 ISO8601 格式字符串 \'2020-04-02T08:02:17-05:00\'</span>\n\n<span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'2019-01-25\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'[YYYYescape] YYYY-MM-DDTHH:mm:ssZ[Z]\'</span><span class=\"token punctuation\">)</span> \n<span class=\"token comment\">// \'YYYYescape 2019-01-25T00:00:00-02:00Z\'</span>\n\n<span class=\"token function\">dayjs</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'2019-01-25\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">.</span><span class=\"token function\">format</span><span class=\"token punctuation\">(</span><span class=\"token string\">\'DD/MM/YYYY\'</span><span class=\"token punctuation\">)</span> <span class=\"token comment\">// \'25/01/2019\'</span></code></pre>\n</div>', NULL, 3003, 10, 14, 'exam-app', '2023-02-01 19:09:59', '2023-02-01 19:09:59');
